import { Link } from "react-router-dom"
import style from './NavBar.module.css'

const NavBar = () => {
    return(
        <div className={style.container}>
            <Link to='/'><button>Home</button></Link>
            <Link to='/about'><button>About</button></Link>
            <Link to='/skills'><button>Skills</button></Link>
            <Link to='/projects'><button>Projects</button></Link>
            <Link to='/contact'><button>Contact</button></Link>
            <a className={style.linkedin} href="https://www.linkedin.com/in/cesar-leiva/"><img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.pngwing.com%2Fen%2Ffree-png-blesz&psig=AOvVaw2O3Pt3YP-B3_FLaUnIvHAI&ust=1680440540783000&source=images&cd=vfe&ved=0CBAQjRxqFwoTCOisytHeiP4CFQAAAAAdAAAAABAE" alt="" /></a>
        </div>
    )
}

export default NavBar;
